// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./SyndicateClosedEndFundLogic.sol";

/// @author Syndicate Inc.
/// @notice Handle member distribution accounting and ERC20 transfers
contract SyndicateClosedEndFundDistributionLogicV0 is
    SyndicateClosedEndFundLogic
{
    using SafeERC20 for IERC20;

    /// @notice Used to initialize the Syndicate contract.
    constructor(address owner, address storeAddress)
        SyndicateClosedEndFundLogic(owner, storeAddress)
    {}

    // Events-------------------------------------------------------------------

    /// @notice A manager sets a distribution for a new ERC20 address.
    /// This is called by `managerSetDistributions()` the first time a
    /// distribution is set for a particular ERC20 address.
    event DistributionERC20AddressAdded(
        address indexed syndicateAddress,
        address indexed distributionERC20Address
    );

    /// @notice A manager sets a distribution. It is important that the manager
    /// holds such distribution assets in their wallet for members to claim.
    event DistributionAdded(
        address indexed syndicateAddress,
        address indexed distributionERC20Address,
        uint256 amountToMembers,
        uint256 amountToSyndicate,
        uint256 amountToManager
    );

    /// @notice A member claims a distribution by withdrawing their assets or a
    /// manager sets a distribution claimed on behalf of a member. Managers
    /// can only claim a distribution for a member on modifiable syndicates.
    /// @dev `actor` is used to differentiate between who is triggering the
    /// event emission. Current options are "member" and "manager", but more
    /// may be introduced (e.g. "integration").
    event DistributionClaimed(
        address indexed syndicateAddress,
        address indexed memberAddress,
        address indexed distributionERC20Address,
        uint256 amount,
        string actor
    );

    // Functions----------------------------------------------------------------

    /// @notice Used by a manager to initialize or increase the available
    /// distributions for multiple ERC20 tokens after a Syndicate has been
    /// closed.
    /// @param syndicateAddress The address of the Syndicate
    /// @param distributionERC20Addresses The ERC20 contract addresses of the
    /// distributions. Distributions can be set for any ERC20 token, including
    /// the deposit token.
    /// @param amounts The amounts to be added to the available distributions
    /// of each ERC20 token indexed in `distributionERC20Addresses`. This array
    /// must have the same length as `distributionERC20Addresses`.
    function managerSetDistributions(
        address syndicateAddress,
        address[] calldata distributionERC20Addresses,
        uint256[] calldata amounts
    ) public onlyManager(syndicateAddress) onlyClosed(syndicateAddress) {
        // Both passed-in arrays must have the same length
        require(
            distributionERC20Addresses.length == amounts.length,
            "ARRAY_LENGTHS_DIFFER"
        );

        // Enable distributions if they are currently disabled
        if (!store.distributing(syndicateAddress)) {
            require(
                store.managerFeeAddress(syndicateAddress) != address(0),
                "FEE_ADDR_NOT_SET"
            );
            store.setDistributing(syndicateAddress, true);
        }

        for (uint256 i = 0; i < distributionERC20Addresses.length; i++) {
            _setDistribution(
                syndicateAddress,
                distributionERC20Addresses[i],
                amounts[i]
            );
        }
    }

    /// @notice Used by a manager to modify the claimed distribution amount for
    /// a given member address
    /// @param syndicateAddress The address of the Syndicate
    /// @param memberAddresses The addresses of the members whose info is being
    /// set.
    /// @param distributionERC20Addresses The ERC20 contract addresses of the
    /// distribution.
    /// @param amounts The amounts to increase the claimed distribution of the
    /// corresponding index in memberAddresses. All paramter arrays must match
    /// exactly in length.
    /// @notice This function can only be called if the Syndicate is modifiable.
    /// The modifiable boolean is set by the manager on creation and cannot be
    /// changed after the Syndicate is created.
    /// @notice Claimed distributions can only be raised. If we allowed a
    /// manager to lower a member's claimed distributions, the manager's token
    /// allowance and token balance may not be enough to cover all future
    /// distributions.
    /// @notice Claimed distributions cannot exceed the member's eligible
    /// distributions as calculated from their deposit. If we allowed a manager
    /// to raise a member's claimed distributions above their eligible
    /// distributions, we would have to adjust `distributionTotal` accordingly
    /// and this would result in every other member being eligible for an
    /// additional distribution, which the manager may not have a sufficient
    /// allowance/balance to cover.
    /// @notice This function can only be called after distributions are
    /// enabled. Before distributions are enabled, there is no reason to call
    /// this function since there are no distributions available to claim.
    function managerSetDistributionsClaimedForMembers(
        address syndicateAddress,
        address[] calldata memberAddresses,
        address[] calldata distributionERC20Addresses,
        uint256[] calldata amounts
    )
        public
        onlyManager(syndicateAddress)
        onlyClosed(syndicateAddress)
        onlyModifiable(syndicateAddress)
    {
        // All three passed-in arrays must have the same length
        require(
            memberAddresses.length == amounts.length &&
                distributionERC20Addresses.length == amounts.length,
            "ARRAY_LENGTHS_DIFFER"
        );

        for (uint256 i = 0; i < memberAddresses.length; i++) {
            _claimDistribution(
                syndicateAddress,
                memberAddresses[i],
                distributionERC20Addresses[i],
                amounts[i],
                true
            );
        }
    }

    /// @param syndicateAddress The Syndicate that a member will claim
    /// distributions from
    /// @param ERC20Addresses The token types to be transferred from the
    /// Syndicate to the member. Members may only claim distributions from
    /// ERC20 contract addresses that the manager has set for distribution.
    /// @param amounts The amounts (in token types specified by
    /// `distributionERC20Addresses`) to be claimed
    /// @notice The member is identified via `msg.sender`. This function must
    /// be called from the address associated with the member's deposit.
    /// @notice This function may only be called after the Syndicate is closed
    /// by the manager, though the Syndicate may be closed for some time before
    /// a distribution is set (e.g. after funds have been raised but while they
    /// are being used for investments)
    /// @dev Distribution claims are processed before any fees that an ERC20
    /// token may assess. The amount that all users receive may be lower if an
    /// ERC20 token takes a fee upon transfers.
    function memberClaimDistributions(
        address syndicateAddress,
        address[] calldata ERC20Addresses,
        uint256[] calldata amounts
    ) public onlyNotManager(syndicateAddress) onlyClosed(syndicateAddress) {
        // Both passed-in arrays must have the same length
        require(
            ERC20Addresses.length == amounts.length,
            "ARRAY_LENGTHS_DIFFER"
        );

        for (uint256 i = 0; i < ERC20Addresses.length; i++) {
            _claimDistribution(
                syndicateAddress,
                msg.sender,
                ERC20Addresses[i],
                amounts[i],
                false
            );
        }
    }

    /// @notice Get a Syndicate's total distributions for a given ERC20
    /// @param syndicateAddress The address of the Syndicate
    /// @param distributionERC20Address The ERC20 address of the token whose
    /// distributions are being queried
    /// @return The `distributionTotal` for a given `distributionERC20Address`
    function getDistributionTotal(
        address syndicateAddress,
        address distributionERC20Address
    ) public view returns (uint256) {
        return
            store.distributionTotal(syndicateAddress, distributionERC20Address);
    }

    /// @notice Get a member's claimed distributions for a given ERC20
    /// @param syndicateAddress The address of the Syndicate
    /// @param memberAddress The address of the member whose info is being
    /// queried
    /// @param distributionERC20Address The ERC20 address of the token whose
    /// distributions are being queried
    /// @return The distribution claimed by a member for a given
    /// `distributionERC20Address`
    function getDistributionClaimedMember(
        address syndicateAddress,
        address memberAddress,
        address distributionERC20Address
    ) public view returns (uint256) {
        return
            store.distributionClaimedMember(
                syndicateAddress,
                distributionERC20Address,
                memberAddress
            );
    }

    /// @notice Get a member's unclaimed distribution for a given ERC20
    /// @param syndicateAddress The address of the Syndicate
    /// @param memberAddress The address of the member whose info is being
    /// queried
    /// @param distributionERC20Address The ERC20 address of the token whose
    /// distributions are being queried
    /// @return The unclaimed distribution for a member for a given
    /// `distributionERC20Address`
    function getDistributionUnclaimedMember(
        address syndicateAddress,
        address memberAddress,
        address distributionERC20Address
    ) public view returns (uint256) {
        uint256 depositMember;
        uint256 depositTotal;
        uint256 distributionClaimedMember;
        uint256 distributionTotal;
        uint256 eligibleDistribution;

        depositMember = store.depositMember(syndicateAddress, memberAddress);
        depositTotal = store.depositTotal(syndicateAddress);
        distributionClaimedMember = getDistributionClaimedMember(
            syndicateAddress,
            memberAddress,
            distributionERC20Address
        );
        distributionTotal = getDistributionTotal(
            syndicateAddress,
            distributionERC20Address
        );

        eligibleDistribution = calculateEligibleDistribution(
            depositMember,
            depositTotal,
            distributionClaimedMember,
            distributionTotal
        );
        require(eligibleDistribution > 0, "NO_ELIGIBLE_DIST");

        return eligibleDistribution;
    }

    /// @notice Get a Syndicate's total claimed distributions for a given ERC20
    /// @param syndicateAddress The address of the Syndicate
    /// @param distributionERC20Address The ERC20 address of the token whose
    /// distributions are being queried
    /// @return The `distributionTotal` for a given `distributionERC20Address`
    function getDistributionClaimedTotal(
        address syndicateAddress,
        address distributionERC20Address
    ) public view returns (uint256) {
        return
            store.distributionClaimedTotal(
                syndicateAddress,
                distributionERC20Address
            );
    }

    /// @notice Calculates the maximum value in distribution tokens that a
    /// member can withdraw based on their percent ownership of the Syndicate,
    /// the total amount of a particular token available for distribution, and
    /// the amount of that distribution token that the member has already
    /// claimed.
    /// @param depositMember Member's deposit to the Syndicate at the moment
    /// that it was closed by the manager
    /// @param depositTotal Total deposits (from anyone) to the Syndicate
    /// @param distributionClaimedMember Value in distributions that user has
    /// withdrawn from the fund already.  Make sure this matches the token type
    /// of `distributionTotal`.
    /// @param distributionTotal Total distributions available from the fund,
    /// claimed or not.  Make sure this matches the token type of
    /// `distributionClaimedMember`.
    /// @return Value in distributions that user is eligible to withdraw
    /// @dev HIGH RISK: If this calculation is incorrect, a user could withdraw
    /// more or less than they are entitled to.
    function calculateEligibleDistribution(
        uint256 depositMember,
        uint256 depositTotal,
        uint256 distributionClaimedMember,
        uint256 distributionTotal
    ) public pure returns (uint256) {
        // If the fund is empty, we need to return to prevent division by 0
        if (depositTotal == 0) return 0;
        // Solves this equation for eligibleDistributions:
        // depositMember / depositTotal = (eligibleDistributions +
        //      distributionClaimedMember) / distributionTotal
        uint256 eligibleDistributions = (((depositMember * distributionTotal) /
            depositTotal) - distributionClaimedMember);
        return eligibleDistributions;
    }

    /// @notice Calculates the amount of a distribution that goes to the members,
    /// Syndicate Protocol, and the syndicate manager.
    /// @param amount Total amount to be withdrawn, including fees.
    /// @param syndicateDistributionShareBasisPoints Distribution share to
    /// Syndicate Protocol in basis points (i.e. as a fraction divided by 10000)
    /// @param managerDistributionShareBasisPoints Share to the syndicate manager
    /// in basis points (i.e. as a fraction divided by 10000)
    /// @return Tuple of the amounts (toMembers, toSyndicate, toManager) that
    /// will be transferred, together adding up to the passed amount.
    function calculateDistributionShares(
        uint256 amount,
        uint256 syndicateDistributionShareBasisPoints,
        uint256 managerDistributionShareBasisPoints
    )
        public
        pure
        returns (
            uint256,
            uint256,
            uint256
        )
    {
        uint256 toSyndicate = (amount * syndicateDistributionShareBasisPoints) /
            BASIS_POINTS_DENOMINATOR;
        uint256 toManager = (amount * managerDistributionShareBasisPoints) /
            BASIS_POINTS_DENOMINATOR;
        uint256 toMembers = amount - toManager - toSyndicate;

        // I believe that there are cases where this can fail (e.g. if
        // there is wei left over from truncating the division). We can
        // catch this during formal verification and determine whether
        // we want to make amount >= instead of == or just give the
        // remaining wei to the user
        require(
            amount == toMembers + toSyndicate + toManager,
            "FEE_CALC_FAILED"
        );

        return (toMembers, toSyndicate, toManager);
    }

    // Internal functions-------------------------------------------------------

    /// @notice Initalize or increase a distribution for a Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @param distributionERC20Address The ERC20 contract address of the
    /// distribution
    /// @param amount The amount by which the available distribution should be
    /// increased.
    /// @notice Syndicate distribution shares and manager distribution shares are
    /// assessed when a distribution is set by a manager, not when a distribution
    ///  is claimed by a user. This ensures that unclaimed distributions do not
    /// prevent Syndicate and managers from receiving their portion of the
    /// distribution, and in general makes receiving distributions much more predictable.
    /// @notice This function does not verify that the manager has set an
    /// appropriate allowance for the desired balance. It is the responsibility
    /// of the manager to do so, since any allowance checks that could occur in
    /// this function would be vulnerable to front-running.
    /// @dev Note that distribution amount available to users is after Syndicate's
    /// and the manager's shares are assessed. For example, if a manager sets a
    /// distribution of 1000 DAI and the distribution share to Syndicate is 0.50%
    /// (50 basis points) and the manager's distribution share is 2.00% (200 basis
    /// points), the amount available for distribution to users would be 97.5%
    /// of 1000 -- i.e. 975 USDC.
    /// @dev This function makes setting large number of distributions slightly
    /// more gas efficient by creating an internal setDistribution function that
    /// skips the modifier check.
    function _setDistribution(
        address syndicateAddress,
        address distributionERC20Address,
        uint256 amount
    ) internal onlyLogicContractAllowed() {
        IERC20 distributionERC20 = IERC20(distributionERC20Address);

        // Checks

        // If the ERC20 address has not already been set for distribution in
        // `SyndicateMappings`, mark it as available, and emit an event
        // broadcasting that a new token is available for distribution.
        if (
            !store.distributionERC20Addresses(
                syndicateAddress,
                distributionERC20Address
            )
        ) {
            store.setDistributionERC20Addresses(
                syndicateAddress,
                distributionERC20Address,
                true
            );
            emit DistributionERC20AddressAdded(
                syndicateAddress,
                distributionERC20Address
            );
        }

        // Effects
        uint256 amountToMembers;
        uint256 amountToSyndicate;
        uint256 amountToManager;

        (
            amountToMembers,
            amountToSyndicate,
            amountToManager
        ) = calculateDistributionShares(
            amount,
            store.syndicateDistributionShareBasisPoints(syndicateAddress),
            store.managerDistributionShareBasisPoints(syndicateAddress)
        );

        // Increment the distribution total and emit an event
        store.setDistributionTotal(
            syndicateAddress,
            distributionERC20Address,
            store.distributionTotal(
                syndicateAddress,
                distributionERC20Address
            ) + amountToMembers
        );

        // Interactions
        distributionERC20.transferFrom(
            store.managerCurrent(syndicateAddress),
            getSyndicateFeeAddress(),
            amountToSyndicate
        );

        distributionERC20.transferFrom(
            store.managerCurrent(syndicateAddress),
            store.managerFeeAddress(syndicateAddress),
            amountToManager
        );

        emit DistributionAdded(
            syndicateAddress,
            distributionERC20Address,
            amountToMembers,
            amountToSyndicate,
            amountToManager
        );
    }

    function _claimDistribution(
        address syndicateAddress,
        address memberAddress,
        address ERC20Address,
        uint256 amount,
        bool calledByManager
    ) internal onlyLogicContractAllowed() {
        // If the Syndicate is closed but distributions have not been enabled,
        // the Syndicate manager may be using the funds for investment.
        // Therefore, withdrawals are unavailable until distributions are
        // enabled.
        require(store.distributing(syndicateAddress), "SYN_NOT_DISTRIBUTING");
        // If the Syndicate is closed and distributions are enabled, funds can
        // be withdrawn in any ERC20 token set for distribution. This is added
        // to the sender's claimed distribution totals to track the remaining
        // amount they are eligible to withdraw. Fees are sent to the manager
        // and Syndicate upon withdrawal.

        // Distribution ERC20 must be enabled for withdrawals by manager.
        require(
            store.distributionERC20Addresses(syndicateAddress, ERC20Address),
            "NO_DIST_AT_ERC20"
        );

        // Without this line, a member could spam withdrawals of 0. It is
        // additionally necessary to protect `_processWithdrawalOpen` from
        // decrementing `numMembersCurrent` when a member with a deposit of 0
        // withdraws 0.
        require(amount > 0, "DIST<=0");

        // The withdrawal amount must not exceed the member's distribution share
        // in the Syndicate less the distributions they have already
        // claimed.
        // HIGH RISK: Without this check, a user could withdraw more than
        // they are eligible to.
        require(
            amount <=
                calculateEligibleDistribution(
                    store.depositMember(syndicateAddress, memberAddress),
                    store.depositTotal(syndicateAddress),
                    store.distributionClaimedMember(
                        syndicateAddress,
                        ERC20Address,
                        memberAddress
                    ),
                    store.distributionTotal(syndicateAddress, ERC20Address)
                ),
            "DIST>ELIGIBLE"
        );

        // Effects
        // Increase the member's claimed distributions
        store.setDistributionClaimedMember(
            syndicateAddress,
            ERC20Address,
            memberAddress,
            store.distributionClaimedMember(
                syndicateAddress,
                ERC20Address,
                memberAddress
            ) + amount
        );

        // Increase total claimed distributions
        store.setDistributionClaimedTotal(
            syndicateAddress,
            ERC20Address,
            store.distributionClaimedTotal(syndicateAddress, ERC20Address) +
                amount
        );

        if (calledByManager) {
            emit DistributionClaimed(
                syndicateAddress,
                memberAddress,
                ERC20Address,
                amount,
                "manager"
            );
        } else {
            IERC20 withdrawalERC20 = IERC20(ERC20Address);

            // The user should get paid first, then Syndicate, then the
            // manager. This is because the manager controls the allowance --
            // otherwise the manager could stop someone from getting paid by
            // lowering the allowance below the distribution amount. If the
            // manager wants to get paid, they need to set a proper
            // allowance and not have any of these transfers fail.
            // Note that if any one transfer reverts, the entire transaction
            // will safely revert. This ordering just accounts for ERC-20s that
            // might have used a custom implementation and not revert upon a
            // `transferFrom()` that exceeds the balance or the allowance
            // HIGH RISK: If we did not use `msg.sender`, this could be
            // used to redirect funds from users other than the wallet
            // holder (or smart contract owner, if a DAO is making the
            // withdrawal).
            withdrawalERC20.transferFrom(
                store.managerCurrent(syndicateAddress),
                memberAddress,
                amount
            );

            emit DistributionClaimed(
                syndicateAddress,
                memberAddress,
                ERC20Address,
                amount,
                "member"
            );
        }
    }
}

